import React from 'react';
import'../../App.css';
import HeroSection from '../HeroSection';
import SearchBar from '../Searchbar';
import SearchPage from '../SearchPage';
import Results from '../ResultsList';

function Home () {
    return (
        <>
        <HeroSection />
        <SearchBar />
        <SearchPage />
        <Results />
        </>
    );
}

export default Home;
